    false,nt"url": null,nt"notes": "This annual narrative report for Beltrami
    Island and Red Lake Wildlife Management Area summarizes refuge activities during
    FY 1993.  The report begins with an introduction to the refuge and a summary of
    the yearu2019s climatic and habitat conditions.   Land acquisition is also covered
    in this section, as is the system status. Planning, administration and habitat management
    sections are next. The wildlife section of the report discusses wildlife diversity
    as well as specific migratory species.  Interpretation and recreation are also described;
    topics include outdoor classrooms, trails, hunting and fishing]. The report consludes
    with an quipment and facilities section that discusses construction and maintenance
